// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


contract ra2 {

    struct Agent {
        uint256 id;
        string UUID;
        bool attested;
   //     bool attestationPending;
    }

    bool attestationPending;
    uint256 public lastAgentId;
    event VerifierEvent(string agentUUIDToBeVerified, string verifier, string measurement);
    event MeasureEvent(uint256 indexed agentIdToBeMeasured, string agentUUIDToBeMeasured);
    event requestMeasureFromSecaasDbEvent(string agentUUIDToBeMeasured, string agentUUIDVerifier, string measurementFromMeasurer);
    event sendMeasureToVerifierEvent(string agentUUIDToBeVerified, string agentUUIDVerifier, string measurementFromMeasurer, string measurementFromSecaas);
    event attestationResultEvent(string agentUUIDToBeVerified, string agentUUIDVerifier, bool result);

    event AgentAdded(uint256 indexed agentIdMeasured, uint256 indexed agentIdVerifier);
    event LogEvent(string msg1, string msg2, uint256 nb, bool flag);


    mapping(string => Agent) public agentUUIDmap;
    mapping(uint256 => string) public idToUUIDmap;


    constructor() {
      lastAgentId = 0;
      attestationPending = false;
    }

    function getAttestationPending() public view returns (bool) {
      return attestationPending;
    }


    function addAgent(string calldata agentUUID) public {
      Agent memory newAgent = Agent(lastAgentId, agentUUID, false);
      agentUUIDmap[agentUUID] = newAgent;
      idToUUIDmap[lastAgentId] = agentUUID;
      lastAgentId++;
      attestationPending = true;

    }


    function registerAgent(string calldata agentUUID) public {
      emit MeasureEvent(lastAgentId, agentUUID);
    }


    function requestMeasureFromSecaasDb(string calldata agentUUIDToBeVerified, string calldata agentUUIDVerifier, string calldata measurementFromMeasurer) public {
      emit requestMeasureFromSecaasDbEvent(agentUUIDToBeVerified, agentUUIDVerifier, measurementFromMeasurer);
    }


    function sendMeasureToVerifier(string calldata agentUUIDToBeVerified,string calldata agentUUIDVerifier, string calldata measurementFromMeasurer, string calldata measurementFromSecaas) public {
      emit sendMeasureToVerifierEvent(agentUUIDToBeVerified, agentUUIDVerifier, measurementFromMeasurer, measurementFromSecaas);
    }

    function getVerifier(string calldata agentUUID, string calldata measurement) public {
        string memory verifier = "secaas";
        for (uint256 i = 0; i <= lastAgentId; i++) {
          string memory uuid = idToUUIDmap[i];
          Agent memory agent = agentUUIDmap[uuid];
          emit LogEvent("agent attested ", uuid, i, agent.attested);
          if (agent.attested) {
            verifier = uuid;
          }
        }
        emit VerifierEvent(agentUUID, verifier, measurement);
    }

    function attestAgent(string calldata agentUUID,string calldata verifier) public {
      Agent storage agent = agentUUIDmap[agentUUID];
      agent.attested = true;
      attestationPending = false;
      emit attestationResultEvent(agentUUID, verifier, true);
    }


}
